rect\" title=\"\u0415\u0432\u0433\u0435\u043d\u0438\u0439 IV (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u0415\u0432\u0433\u0435\u043d\u0438\u0439 IV<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%B7%D0%B0%D0%BD%D1%82%D0%B8%D1%8F\" title=\"\u0412\u0438\u0437\u0430\u043d\u0442\u0438\u044f\">\u0432\u0438\u0437\u0430\u043d\u0442\u0438\u0439\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\">\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D0%B0%D0%BD%D0%BD_VIII_%D0%9F%D0%B0%D0%BB%D0%B5%D0%BE%D0%BB%D0%BE%D0%B3\" title=\"\u0418\u043e\u0430\u043d\u043d VIII \u041f\u0430\u043b\u0435\u043e\u043b\u043e\u0433\">\u0418\u043e\u0430\u043d\u043d VIII<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u0424\u043b\u043e\u0440\u0435\u043d\u0442\u0438\u0439\u0441\u043a\u0443\u044e \u0443\u043d\u0438\u044e, \u0441\u043e\u0437\u0434\u0430\u0432\u0448\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D0%BA%D0%BE%D0%BA%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%BA%D0%B8\" class=\"mw-redirect\" title=\"\u0413\u0440\u0435\u043a\u043e\u043a\u0430\u0442\u043e\u043b\u0438\u043a\u0438\">\u0433\u0440\u0435\u043a\u043e\u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0446\u0435\u0440\u043a\u043e\u0432\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1483_%D0%B3%D0%BE%D0%B4\" title=\"1483 \u0433\u043e\u0434\">1483<\/a>&#160;\u2014 \u043a\u043e\u0440\u043e\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4_III\" title=\"\u0420\u0438\u0447\u0430\u0440\u0434 III\">\u0420\u0438\u0447\u0430\u0440\u0434 III \u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1535_%D0%B3%D0%BE%D0%B4\" title=\"1535 \u0433\u043e\u0434\">1535<\/a>&#160;\u2014 \u043f\u043e \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044e \u0432 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0438\u0437\u043c\u0435\u043d\u0435 \u043a\u0430\u0437\u043d\u0451\u043d \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u0433\u0443\u043c\u0430\u043d\u0438\u0441\u0442, \u043b\u043e\u0440\u0434-\u043a\u0430\u043d\u0446\u043b\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81\" title=\"\u041c\u043e\u0440, \u0422\u043e\u043c\u0430\u0441\">\u0422\u043e\u043c\u0430\u0441 \u041c\u043e\u0440<\/a>, \u043f\u043e\u0437\u0436\u0435 \u043f\u0440\u0438\u0447\u0438\u0441\u043b\u0435\u043d\u043d\u044b\u0439 \u043a \u043b\u0438\u043a\u0443 \u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0441\u0432\u044f\u0442\u044b\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1609_%D0%B3%D0%BE%D0%B4\" title=\"1609 \u0433\u043e\u0434\">1609<\/a>&#160;\u2014 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u0438\u043c\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%B4%D0%BE%D0%BB%D1%8C%D1%84_II_(%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u0420\u0443\u0434\u043e\u043b\u044c\u0444 II (\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438)\">\u0420\u0443\u0434\u043e\u043b\u044c\u0444 II<\/a> \u0438\u0437\u0434\u0430\u043b \u0413\u0440\u0430\u043c\u043e\u0442\u0443 \u0432\u0435\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u0430, \u0433\u0430\u0440\u0430\u043d\u0442\u0438\u0440\u0443\u044e\u0449\u0443\u044e \u0440\u0435\u043b\u0438\u0433\u0438\u043e\u0437\u043d\u0443\u044e \u0441\u0432\u043e\u0431\u043e\u0434\u0443 \u0447\u0435\u0448\u0441\u043a\u0438\u043c \u0441\u043e\u0441\u043b\u043e\u0432\u0438\u044f\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1658_%D0%B3%D0%BE%D0%B4\" title=\"1658 \u0433\u043e\u0434\">1658<\/a>&#160;\u2014 \u0446\u0430\u0440\u0441\u043a\u0438\u0435 \u0441\u043b\u0443\u0433\u0438 \u043f\u043e\u0431\u0438\u043b\u0438 \u043f\u043e\u0441\u043b\u0430\u043d\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BD_(%D0%9F%D0%B0%D1%82%D1%80%D0%B8%D0%B0%D1%80%D1%85_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041d\u0438\u043a\u043e\u043d (\u041f\u0430\u0442\u0440\u0438\u0430\u0440\u0445 \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439)\">\u043f\u0430\u0442\u0440\u0438\u0430\u0440\u0445\u0430 \u041d\u0438\u043a\u043e\u043d\u0430<\/a>, \u0447\u0442\u043e \u0441\u0442\u0430\u043b\u043e \u043d\u0430\u0447\u0430\u043b\u043e\u043c \u0440\u0430\u0437\u0440\u044b\u0432\u0430 \u0446\u0430\u0440\u044f \u0441 \u0433\u043b\u0430\u0432\u043e\u0439 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1661_%D0%B3%D0%BE%D0%B4\" title=\"1661 \u0433\u043e\u0434\">1661<\/a>&#160;\u2014 \u043d\u0430 \u043f\u0440\u0430\u0432\u043e\u043c \u0431\u0435\u0440\u0435\u0433\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%B0%D1%80%D0%B0\" title=\"\u0410\u043d\u0433\u0430\u0440\u0430\">\u0410\u043d\u0433