43e\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u043e \u0441\u0435\u0431\u044f \u0423\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435\u043c \u0438 \u0437\u0430\u044f\u0432\u0438\u043b\u043e \u043e \u0441\u0443\u0432\u0435\u0440\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u043d\u0430\u0440\u043e\u0434\u0430 \u043f\u043e \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044e \u043a \u0432\u043b\u0430\u0441\u0442\u0438 \u043a\u043e\u0440\u043e\u043b\u044f.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1803_%D0%B3%D0%BE%D0%B4\" title=\"1803 \u0433\u043e\u0434\">1803<\/a>&#160;\u2014 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B6%D0%B0%D1%80%D0%BD%D0%B0%D1%8F_%D0%BE%D1%85%D1%80%D0%B0%D0%BD%D0%B0\" title=\"\u041f\u043e\u0436\u0430\u0440\u043d\u0430\u044f \u043e\u0445\u0440\u0430\u043d\u0430\">\u043f\u043e\u0436\u0430\u0440\u043d\u0430\u044f \u043a\u043e\u043c\u0430\u043d\u0434\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1809_%D0%B3%D0%BE%D0%B4\" title=\"1809 \u0433\u043e\u0434\">1809<\/a>&#160;\u2014 \u043f\u043e \u043f\u0440\u0438\u043a\u0430\u0437\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430<\/a> \u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%B9_VII_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041f\u0438\u0439 VII (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u041f\u0438\u0439 VII<\/a> \u043f\u043e\u0445\u0438\u0449\u0435\u043d \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD\" title=\"\u0412\u0430\u0442\u0438\u043a\u0430\u043d\">\u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0430<\/a> \u0438 \u0432\u044b\u0432\u0435\u0437\u0435\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D0%BD%D0%BE%D0%B1%D0%BB%D1%8C\" title=\"\u0413\u0440\u0435\u043d\u043e\u0431\u043b\u044c\">\u0413\u0440\u0435\u043d\u043e\u0431\u043b\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1819_%D0%B3%D0%BE%D0%B4\" title=\"1819 \u0433\u043e\u0434\">1819<\/a>&#160;\u2014 \u043d\u0430\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435\u043c<\/a> \u0432 \u043a\u043e\u0440\u0437\u0438\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB%D1%8C%D1%84%D1%8C%D0%B5%D1%80\" title=\"\u041c\u043e\u043d\u0433\u043e\u043b\u044c\u0444\u044c\u0435\u0440\">\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u0433\u043e \u0448\u0430\u0440\u0430<\/a> \u0432\u0441\u043f\u044b\u0445\u043d\u0443\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B3%D0%BE%D0%BD%D1%8C\" title=\"\u041e\u0433\u043e\u043d\u044c\">\u043e\u0433\u043e\u043d\u044c<\/a> \u0438 \u043f\u0435\u0440\u0435\u043a\u0438\u043d\u0443\u043b\u0441\u044f \u043d\u0430 \u043e\u0431\u043e\u043b\u043e\u0447\u043a\u0443. \u0413\u043e\u0440\u044f\u0449\u0438\u0439 \u0448\u0430\u0440 \u0443\u043f\u0430\u043b \u043d\u0430 \u043a\u0440\u044b\u0448\u0443 \u0434\u043e\u043c\u0430, \u0432\u043e\u0437\u0434\u0443\u0445\u043e\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%B0%D0%BD%D1%88%D0%B0%D1%80,_%D0%9C%D1%8D%D1%80%D0%B8_%D0%9C%D0%B0%D0%B4%D0%BB%D0%B5%D0%BD-%D0%A1%D0%BE%D1%84%D0%B8\" class=\"mw-redirect\" title=\"\u0411\u043b\u0430\u043d\u0448\u0430\u0440, \u041c\u044d\u0440\u0438 \u041c\u0430\u0434\u043b\u0435\u043d-\u0421\u043e\u0444\u0438\">\u0433-\u0436\u0430 \u0411\u043b\u0430\u043d\u0448\u0430\u0440<\/a> \u0440\u0430\u0437\u0431\u0438\u043b\u0430\u0441\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1854_%D0%B3%D0%BE%D0%B4\" title=\"1854 \u0433\u043e\u0434\">1854<\/a>&#160;\u2014 \u0432 \u0414\u0436\u0435\u043a\u0441\u043e\u043d\u0435 (\u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%87%D0%B8%D0%B3%D0%B0%D0%BD\" title=\"\u041c\u0438\u0447\u0438\u0433\u0430\u043d\">\u041c\u0438\u0447\u0438\u0433\u0430\u043d<\/a>) \u043f\u0440\u043e\u0448\u0451\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u044a\u0435\u0437\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_(%D0%A1%D0%A8%D0%90)\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f (\u0421\u0428\u0410)\">\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1863_%D0%B3%D0%BE%D0%B4\" title=\"1863 \u0433\u043e\u0434\">1863<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0439 \u0431\u0430\u043d\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Cr%C3%A9dit_Lyonnais\" title=\"Cr\u00e9dit Lyonnais\">Cr\u00e9dit Lyonnais<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1880_%D0%B3%D0%BE%D0%B4\" title=\"1880 \u0433\u043e\u0434\">1880<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u043e \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u043e \u043f\u0440\u0430\u0437\u0434\u043d\u043e\u0432\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BD%D1%8C_%D0%B2%D0%B7%D1%8F%D1%82%D0%B8%D1%8F_%D0%91%D0%B0%D1%81%D1%82%D0%B8%D0%BB%D0%B8%D0%B8\" title=\"\u0414\u0435\u043d\u044c \u0432\u0437\u044f\u0442\u0438\u044f \u0411\u0430\u0441\u0442\u0438\u043b\u0438\u0438\">\u0414\u043d\u044f \u0432\u0437\u044f\u0442\u0438\u044f \u0411\u0430\u0441\u0442\u0438\u043b\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1885_%D0%B3%D0%BE%D0%B4\" title=\"1885 \u0433\u043e\u0434\">1885<\/a>&#160;\u2014 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043c\u0438\u0440\u0435 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0443 \u0432\u0432\u0435\u0434\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BA%D1%86%D0%B8%D0%BD%D0%B0\" title=\"\u0412\u0430\u043a\u0446\u0438\u043d\u0430\">\u0432\u0430\u043a\u0446\u0438\u043d\u0430<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%88%D0%B5%D0%BD%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0411\u0435\u0448\u0435\u043d\u0441\u0442\u0432\u043e\">\u0431\u0435\u0448\u0435\u043d\u0441\u0442\u0432\u0430<\/a>. \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0443\u0447\u0451\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%81%D1%82%D0%B5%D1%80,_%D0%9B%D1%83%D0%B8\" title=\"\u041f\u0430\u0441\u0442\u0435\u0440, \u041b\u0443\u0438\">\u041b\u0443\u0438 \u041f\u0430\u0441\u0442\u0435\u0440<\/a> \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u0438\u0441\u043f\u044b\u0442\u0430\u043b \u0435\u0451 \u043d\u0430 9-\u043b\u0435\u0442\u043d\u0435\u043c \u043c\u0430\u043b\u044c\u0447\u0438\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B9%D1%81%D1%82%D0%B5%D1%80,_%D0%99%D0%BE%D0%B7%D0%B5%D1%84\" title=\"\u041c\u0430\u0439\u0441\u0442\u0435\u0440, \u0419\u043e\u0437\u0435\u0444\">\u0416\u043e\u0437\u0435\u0444\u0435 \u041c\u0435\u0439\u0441\u0442\u0435\u0440\u0435<\/a>, \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0443\u043a\u0443\u0441\u0438\u043b\u0430 \u0431\u0435\u0448\u0435\u043d\u0430\u044f \u0441\u043e\u0431\u0430\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1899_%D0%B3%D0%BE%D0%B4\" title=\"1899 \u0433\u043e\u0434\">1899<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u043f\u043e\u0440\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8F%D1%80%D0%BD%D1%8B%D0%B9\" title=\"\u041f\u043e\u043b\u044f\u0440\u043d\u044b\u0439\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0441\u043a<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%BB%D1%83%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2\" title=\"\u041a\u043e\u043b\u044c\u0441\u043a\u0438\u0439 \u043f\u043e\u043b\u0443\u043e\u0441\u0442\u0440\u043e\u0432\">\u041c\u0443\u0440\u043c\u0430\u043d\u0435<\/a> (\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933 \u0433\u043e\u0434\u0430<\/a>&#160;\u2014 \u043f\u043e\u0441\u0451\u043b\u043e\u043a \u041f\u043e\u043b\u044f\u0440\u043d\u043e\u0435, \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939 \u0433\u043e\u0434\u0430<\/a> \u0433\u043e\u0440\u043e\u0434 \u041f\u043e\u043b\u044f\u0440\u043d\u044b\u0439).<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0441\u043b\u0443\u0436\u0431\u044b \u043f\u0440\u0430\u0432\u043e\u043f\u043e\u0440\u044f\u0434\u043a\u0430 \u0410\u043c\u0435\u0440\u0438\u043a\u0438 \u0438 \u0415\u0432\u0440\u043e\u043f\u044b \u043e\u0431\u043c\u0435\u043d\u044f\u043b\u0438\u0441\u044c \u043e\u0442\u043f\u0435\u0447\u0430\u0442\u043a\u0430\u043c\u0438 \u043f\u0430\u043b\u044c\u0446\u0435\u0432 \u043f\u043e\u0434\u043e\u0437\u0440\u0435\u0432\u0430\u0435\u043c\u043e\u0433\u043e \u0432 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f\u0445 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430. \u041f\u043e\u043b\u0438\u0446\u0435\u0439\u0441\u043a\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BD%D1%82-%D0%9B%D1%83%D0%B8%D1%81\" title=\"\u0421\u0435\u043d\u0442-\u041b\u0443\u0438\u0441\">\u0421\u0435\u043d\u0442-\u041b\u0443\u0438\u0441\u0430<\/a> \u043f\u0435\u0440\u0435\u0434\u0430\u043b\u0438 \u0434\u0440\u0443\u0433 \u0434\u0440\u0443\u0433\u0443 \u043e\u0442\u043f\u0435\u0447\u0430\u0442\u043a\u0438 \u043f\u0430\u043b\u044c\u0446\u0435\u0432 \u0414\u0436\u043e\u043d\u0430 \u0423\u043e\u043a\u0435\u0440\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1907_%D0%B3%D0%BE%D0%B4\" title=\"1907 \u0433\u043e\u0434\">1907<\/a>&#160;\u2014 \u0438\u0437 \u0414\u0443\u0431\u043b\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0437\u0430\u043c\u043a\u0430 \u0432\u044b\u043a\u0440\u0430\u0434\u0435\u043d\u044b \u0434\u0440\u0430\u0433\u043e\u0446\u0435\u043d\u043d\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%9F%D0%B0%D1%82%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u041e\u0440\u0434\u0435\u043d \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u041f\u0430\u0442\u0440\u0438\u043a\u0430\">\u041e\u0440\u0434\u0435\u043d\u0430 \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u041f\u0430\u0442\u0440\u0438\u043a\u0430<\/a>, \u043f\u043e\u043a\u0440\u043e\u0432\u0438\u0442\u0435\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" class=\"mw-redirect\" title=\"\u0418\u0440\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0418\u0440\u043b\u0430\u043d\u0434\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BA%D0%B3%D0%BE%D0%BB%D1%8C%D0%BC\" title=\"\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\">\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/V_%D0%9B%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B\" class=\"mw-redirect\" title=\"V \u041b\u0435\u0442\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b\">V \u041b\u0435\u0442\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b<\/a> (\u043d\u0430 \u0441\u0430\u043c\u043e\u043c \u0434\u0435\u043b\u0435 \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u044f \u0448\u043b\u0438 \u0441 \u0430\u043f\u0440\u0435\u043b\u044f).<\/li><li>\u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432\u0432\u0435\u0434\u0435\u043d\u043e \u0441\u0442\u0440\u0430\u0445\u043e\u0432\u0430\u043d\u0438\u0435 \u043e\u0442 \u043d\u0435\u0441\u0447\u0430\u0441\u0442\u043d\u044b\u0445 \u0441\u043b\u0443\u0447\u0430\u0435\u0432 \u0438 \u0431\u043e\u043b\u0435\u0437\u043d\u0438.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043f\u043e\u0434\u043d\u044f\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_%D0%BB%D0%B5%D0%B2%D1%8B%D1%85_%D1%8D%D1%81%D0%B5%D1%80%D0%BE%D0%B2\" title=\"\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u043b\u0435\u0432\u044b\u0445 \u044d\u0441\u0435\u0440\u043e\u0432\">\u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%BB%D0%B5%D0%B2%D1%8B%D1%85_%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%BE%D0%B2-%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D0%BE%D0%BD%D0%B5%D1%80%D0%BE%D0%B2\" title=\"\u041f\u0430\u0440\u0442\u0438\u044f \u043b\u0435\u0432\u044b\u0445 \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u043e\u0432-\u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u0435\u0440\u043e\u0432\">\u043b\u0435\u0432\u044b\u0435 \u044d\u0441\u0435\u0440\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u