\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u0432 \u0421\u0421\u0421\u0420 \u043e\u0442\u043a\u0440\u044b\u0442\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0444\u0438\u0446\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u043b\u0438\u043d\u0438\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0438 (\u0411\u0430\u043a\u0443-\u0421\u0430\u0431\u0443\u043d\u0447\u0438).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a><ul><li>\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0441\u044f \u043e\u0434\u0438\u043d \u0438\u0437 \u043f\u0435\u0440\u0432\u044b\u0445 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0432 (\u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%85%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%B4%D0%B5%D0%BB%D0%BE\" title=\"\u0428\u0430\u0445\u0442\u0438\u043d\u0441\u043a\u043e\u0435 \u0434\u0435\u043b\u043e\">\u0428\u0430\u0445\u0442\u0438\u043d\u0441\u043a\u043e\u0435 \u0434\u0435\u043b\u043e<\/a>\u00bb) \u043f\u043e \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044e \u0433\u043e\u0440\u043d\u044b\u0445 \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D1%83%D0%B3%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B1%D0%B0%D1%81%D1%81%D0%B5%D0%B9%D0%BD\" title=\"\u0414\u043e\u043d\u0435\u0446\u043a\u0438\u0439 \u0443\u0433\u043e\u043b\u044c\u043d\u044b\u0439 \u0431\u0430\u0441\u0441\u0435\u0439\u043d\">\u0414\u043e\u043d\u0431\u0430\u0441\u0441\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org